from app import db, User, Product, Cart, CartItem
from app import app

if __name__ == '__main__':
    with app.app_context():
        print("Clearing db...")

# Drop and recreate all tables
        db.drop_all()
        db.create_all()

        # Create users
        user1 = User(username="Daniel Watoro", email="watoro@example.com", password="password123")
        user2 = User(username="Bakari Bubu", email="bubu@example.com", password="password456")
        user3 = User(username="David Wekesa", email="wekesa@example.com", password="password678")
        user4 = User(username="Favado Mwange", email="mwange@example.com", password="password912")
        user5 = User(username="Wilson Mwangi", email="mwangi@example.com", password="password34343")

        # Add users to the session
        db.session.add(user1)
        db.session.add(user2)
        db.session.add(user3)
        db.session.add(user4)
        db.session.add(user5)

        # Create products
        product1 = Product(name="Laptop", description="A high-performance laptop", price=1200.99, stock=10, image_url="data:image/jpeg;base64,")
        product2 = Product(name="Smartphone", description="A smartphone with a great camera", price=799.99, stock=25, image_url="data:image/jpeg;base64,")
        product3 = Product(name="Headphones", description="Noise-cancelling headphones", price=199.99, stock=50, image_url="data:image/jpeg;base64,")

        # Add products to the session
        db.session.add(product1)
        db.session.add(product2)
        db.session.add(product3)

        # Create carts for users
        cart1 = Cart(user=user1)
        cart2 = Cart(user=user2)

        # Add carts to the session
        db.session.add(cart1)
        db.session.add(cart2)

        # Create cart items for cart1
        cart_item1 = CartItem(cart=cart1, product=product1, quantity=1)
        cart_item2 = CartItem(cart=cart1, product=product2, quantity=2)

        # Create cart items for cart2
        cart_item3 = CartItem(cart=cart2, product=product3, quantity=1)

        # Add cart items to the session
        db.session.add(cart_item1)
        db.session.add(cart_item2)
        db.session.add(cart_item3)

        # Commit all the changes
        db.session.commit()

        print("Database seeded successfully!")
